import React from "react";
import "App.scss";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Home } from "components/Home";
import { Login } from "components/Login";
import { Confirmation } from "components/ConfirmEmail";
import Saved from "components/container/WithSaved";

const SidebarContext = React.createContext<boolean | undefined>(undefined);

function App() {
  return (
    <SidebarContext.Provider value={true}>
      <div className="App">
        <Router>
          <Switch>
            <Route path="/confirm">
              <Confirmation />
            </Route>
            <Route path="/login">
              <Login />
            </Route>
            <Route path="/test-user">
              <Saved env="test" />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </Router>
      </div>
    </SidebarContext.Provider>
  );
}

export default App;
